import java.util.Scanner;

public class E1120 {

	public static void main(String[] args) {
	    
	    //Criando o obj
		Scanner input;
		int i, k = 0;
		char e;
		char[] res = new char[10000];
		String num;
		boolean naoColocar = false;
		
		input = new Scanner(System.in);
		
		num = input.nextLine();
		if(!num.equals("0 0"))
			do{
				  
				for(i = 2; i < num.length(); i++)	    
				    if(num.charAt(0) !=  num.charAt(i)){
				        if(num.charAt(i) == '0')
				        	naoColocar = true;
				        	
				        if(naoColocar == false){
					        res[k] = num.charAt(i);
					        k++;
				        }
				        naoColocar = false;
				    }
				
				if(k == 0)
					System.out.println("0");
				else{
					for(i = 0; i < k; i++)
						if(res[i] != '-')
							System.out.printf("%c", res[i]);
					System.out.println();
				}
					
				for(i = 0; i < k; i++)
					res[i] = '-';	
				k = 0;
				num = input.nextLine();
			}while(!(num.charAt(0) == '0' && num.charAt(2) == '0'));
	}
}

